import React from 'react';
import './Footer.css';

class Footer extends React.Component {
  render() {
    return (
      <footer>
        <p>Built with ❤️ by Zach Truong</p>
        <p>Source code: <a href='https://github.com/zacharytruong/cv-project'>Github</a></p>
      </footer>
    )
  }
}

export default Footer;
